CREATE TABLE baqme_bikes(
   bike_id         VARCHAR(36) NOT NULL PRIMARY KEY
  ,lat             NUMERIC(9,6) NOT NULL
  ,lon             NUMERIC(8,6) NOT NULL
  ,is_reserved     BIT  NOT NULL
  ,is_disabled     BIT  NOT NULL
  ,vehicle_type_id VARCHAR(36) NOT NULL
  ,geopoint        VARCHAR(19) NOT NULL
);
